{"0": ["\nУважаемые покупатели, будьте предельно осторожны с этим сеном. У меня им отравились и погибли две морские свинки. Вечером насыпал им сена, одну свинку нашли мёртвой уже на следующее утро, вторая умерла через день. Никакого другого корма в клетке не было. \nЕсли собираетесь кормить этим сеном, делайте это очень по-немногу. \nРанее неоднократно покупал это луговое сено, всё было в порядке, свинки грызли его с большим удовольствием.\n", "2021-03-16T18:01:28Z", "", "0", 1, 0, 5, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "5": ["Сено очень душистое, нет  пыли НО МНОГО БОЛЬШИХ,  ТОЛСТЫХ ,ЖЕСТКИХ ПРУТЬЕВ!!\nДля   мелких  грызунов пришлось  резать ножницами", "2021-01-06T13:39:53Z", "", "0", 0, 1, 3, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "6": ["Очень хорошее сено. Пахнет хорошо.  Покупалась как подстилка.", "2021-01-04T13:43:16Z", "", "0", 1, 0, 5, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "7": ["Отвратительное сено! Сплошные палки, которыми можно выколоть глаза. Приходится вытаскивать из упаковки и искать зелёное сено ибо свинки отказываются его есть.", "2021-01-03T13:19:37Z", "", "0", 0, 1, 1, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "8": ["Пришло всё как и заявлено, очень хорошее на вид сено. Рекомендую.", "2020-12-28T12:42:14Z", "", "0", 1, 0, 5, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "11": ["В целом не плохое сено, раньше покупала по одной пачке в обычном зоомагазине, вроде выгодно, единственное, что морские свинки на 5 пачке уже не очень охотно ели. Но это мелочи жизни.", "2020-12-19T16:28:49Z", "", "0", 0, 1, 4, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "12": ["Не знаю по какой причине пришла одна пачка. Пришлось отказаться.", "2020-12-13T20:14:01Z", "", "0", 0, 1, 2, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "13": ["Сено плохого качества,пришло вместо 6 шт только 3шт!больше не буду заказывать у данного поставщика!", "2020-12-07T00:04:18Z", "", "0", 0, 1, 1, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "14": ["Сено пыльное и рассыпается в труху. Кролик не ест. Нет приятного травяного запаха. Мусор м только", "2020-12-03T18:31:49Z", "", "0", 0, 1, 2, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "15": ["Отличное сено, как только начнёт заканчиваться куплю ещё", "2020-11-24T08:26:07Z", "", "0", 1, 0, 5, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "16": ["Получила хорошо упакованное, к доставке вопросов нет\nНо вот само сено неприятно пахнет, сыровато,  больше всего меня удивило то, что на упаковке написано \"Используется как ПОДСТИЛКА для домашних животных и грызунов\" Хотя при покупки было заявлено как еда. Очень странно\nКачество не очень", "2020-11-10T19:43:17Z", "", "0", 0, 1, 3, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "17": ["Сено пришло полной комплектацией. Сухое, чистое. Без палок и пыли. Не слишком пересушено, ежикам понравилось.", "2020-11-04T05:44:43Z", "", "0", 1, 0, 5, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "19": ["Отличный корм, вкусно пахнет, свинка ест с удовольствием. ", "2020-11-01T16:28:53Z", "", "0", 1, 0, 5, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "20": ["Качество хорошее, пахнет приятно. Заказчик доволен", "2020-10-26T10:33:58Z", "", "0", 2, 0, 5, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "21": ["Сено ужасное: ЖЕЛТОЕ,ГРУБОЕ.БЕЗ ЗАПАХА Кролик не ест От этого сена повсюду мусор и пыль Подмочила водичкой, как рекомендуют для того, чтоб ел кролик, конечно он поел, но появился жидкий стул,что очень опасно для жизни кролика Хотела использовать как подстилку в клетку-УЖАСНАЯ ПЫЛЬ от этого сена Одним словом хоть дешево-получилось дороже-деньги на ветер Придется просто выбросить", "2020-08-25T15:44:56Z", "", "0", 0, 4, 1, "Сено луговое разнотравье 20 литров х 6 шт", "Родные корма"], "23": ["Кролик доволен", "2020-10-14T07:49:23